import React from "react";
import CreateIcon from '@material-ui/icons/Create';

function Styling() {

    return <div className="bottomObj">
        <div className="hovering" style={{ fontSize: "20px", fontWeight: "bold", padding: "10px", marginRight: "10px" }}>B</div>
        <div style={{ fontSize: "20px", fontStyle: "italic", padding: "10px", marginRight: "10px" }}>I</div>
        <div style={{ fontSize: "20px", textDecoration: "underline", padding: "10px", marginRight: "10px" }}>U</div>
        <div style={{ marginRight: "5px" }}><CreateIcon style={{ height: "20px", width: "20px", padding: "3px 0 0 5px", borderBottom: "3px solid yellow" }} /></div>
        <img src="images/down-arrow.png" style={{ width: "10px", height: "10px", marginRight: "10px" }} />
        <div style={{ fontSize: "20px", padding: "0 5px", borderBottom: "4px solid red" }}>A</div>
        <img src="images/down-arrow.png" style={{ width: "10px", height: "10px", marginRight: "10px" }} />
        <img src="images/paint_brush.png" style={{ marginRight: "10px" }} />
        <img src="images/clear_formatting.png" style={{ height: "32px", width: "30px", padding: "5px 0 0", marginRight: "20px" }} />
        <hr style={{ borderTop: "5px dotted black", width: "20px" }} />
    </div>;
}

export default Styling;
